css:
.autoload-images-header {
  background-color: #515130;
  border: 1px solid #776723;
  border-radius: 3px;
  color: rgba(206, 180, 55, 0.92);
  margin: 5px 0;
  padding: 5px 12px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.autoload-images-header .option {
  color: rgba(139, 147, 106, 0.7);
}
.autoload-images-header .option:hover {
  color: rgba(106, 110, 82, 0.88);
}
